import React, { Component } from "react";
import headshot from "../photos/headshotSmaller.png";

class Nameintro extends Component {
  state = {};
  render() {
    return (
      <div style={{ marginLeft: 200, marginTop: 100 }} id="vivanName">
        <div style={{ fontFamily: "Unna", fontStyle: "italic", fontSize: 100 }}>
          vivan &nbsp;
        </div>
        <div
          style={{
            fontFamily: "Unna",
            fontStyle: "Bold 700",
            fontSize: 100,
            position: "relative",
            top: -30,
          }}
        >
          marwaha
        </div>
        <div>
          <img
            src={headshot}
            alt="Vivan headshot"
            style={{
              maxWidth: "30%",
              height: "auto",
              position: "relative",
              top: -90,
              right: -30,
            }}
          />
        </div>
      </div>
    );
  }
}

export default Nameintro;
